import React, {Component} from 'react';
import Header from '../Common/Header'
import {image} from '../assests/img/human-header.png'


class Home extends Component
{
    render()
    {
        return(
            <div>
                <Header
                    title="Welcomne To Our Laboratory!"
                    subtitle="Medical Imaging And Diagnoses"
                    buttonText="Know More"
                    link="/About"
                    showButton={true}
                    image="/img/human-header.png"

                />
            </div>
        )
    }
}

export default Home;
